import * as m from "react";
import a from "../lib/IconBase.es.js";
import t from "../defs/Hammer.es.js";
const e = m.forwardRef((o, r) => /* @__PURE__ */ m.createElement(a, { ref: r, ...o, weights: t }));
e.displayName = "HammerIcon";
const n = e;
export {
  n as Hammer,
  e as HammerIcon
};
